import {BrowserRouter, Re} from 'react-router-dom';
import axios from 'axios';



ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
    <App />
    </BrowserRouter>
  </React.StrictMode>,

  document.getElementById('root')
);

axios.defaults.headers.common['Authorization'] = 'Bearer' + localStorage.getItem('token');

